import React from "react";
import styled from "styled-components";
import StarIcon from "@mui/icons-material/Star"; // Полная звезда
const Wrapper = styled.div`
  margin-top: 60px;
  margin-left: 227px;
`;

const MainTitle = styled.h2`
  font-family: Lato;
  font-size: 30px;
  font-weight: 800;
  line-height: 30px;
`;

const Card = styled.div`
  width: 237px;
  height: 298px;
`;

const Title = styled.h3`
  font-family: Lato;
  font-size: 24px;
  font-weight: 800;
  line-height: 24px;
`;

const EpisodeGenre = styled.div``;

const Stars = styled.p``;

const Movies = () => {
  return (
    <Wrapper>
      <MainTitle>Movies</MainTitle>
      <Card>
        <Title>Loki</Title>
        <Stars>
          <StarIcon />
        </Stars>
        <EpisodeGenre />
      </Card>
    </Wrapper>
  );
};

export default Movies;
